import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import '../css/Principalcss.css'
import logo from '../img/logoUpbBlanco.png';
import pp from '../img/pp.jpg';
import axios from 'axios';
import url from '../Conexions/conexion.js'

const baseURL = url.url + "/Login";
const baseURL2 = url.url + "/Profile/Photo";

class Principal extends Component {
    state = {
        userType: [],
        photo: pp,
        array: '',
        status: false
    }
    getfoto() {

        const config2 = {
            headers: { 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }

        axios.get(baseURL2, config2).then(res => {
            this.setState({
                photo: res.data.photo,
                status: true
            })
            // console.log(res.data.photo)       
        }).catch((error) => {
            // console.log(error);
        });


    }

    getlogin = () => {
        const config2 = {
            headers: { 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }

        axios.get(baseURL, config2).then(res => {
            this.setState({
                userType: res.data.userTypeList,
                status: true

            })
            // console.log(res.data)      
        })
    }
    componentDidMount() {
        this.getlogin();
        this.getfoto();
    }
    cerrarsesion = () => {
        localStorage.removeItem("token");
        window.location = ("/")
    }
    render() {
        const titulos =
            <span>
                <img src={this.state.photo} alt="perfil" className='tamaÃ±o-perfil'></img>
            </span>
            ;
        return (
            <div>
                <Navbar collapseOnSelect fixed='top' className="color-nav" expand="sm" variant="dark">
                    <Container >
                        <Navbar.Brand href="/Principal"><img src={logo} alt="logo"></img></Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="ml-auto">
                                {
                                    this.state.userType.map((elem) => {
                                        // console.log(elem.userType);                                       

                                            if (elem.userType === "administrador" && "docente" && "docente concejero") {
                                                return (
    
                                                    <Nav>
                                                        <Nav.Link href="/Encuesta">NOTAS</Nav.Link>
                                                        <Nav.Link href="/Citas">CITAS</Nav.Link>
                                                        <Nav.Link href="/AsignarHorario">HORARIO</Nav.Link>
                                                        <Nav.Link href="#pricing">VALIDAR</Nav.Link>
                                                        <Nav.Link href="#features">ENCUESTA</Nav.Link>
                                                        <Nav.Link href="/Materias">MATERIAS</Nav.Link>
                                                        <Nav.Link href="/RolesEstudiantes">ROLES</Nav.Link>
                                                        <Nav.Link href="#features">BOT</Nav.Link>
                                                        <Nav.Link href="/Peticiones">PETICIONES</Nav.Link>
                                                        <Nav.Link href="/CorreoUpdate">CORREO</Nav.Link>
                                                        <Nav.Link href="/AgendaConcejero">AGENDA</Nav.Link>
                                                    </Nav>
                                                )
                                            } else if (elem.userType === "administrador" && "docente") {
                                                return (
    
                                                    <Nav>
                                                        <Nav.Link href="/Notas">NOTAS</Nav.Link>
                                                        <Nav.Link href="#pricing">CITAS</Nav.Link>
                                                        <Nav.Link href="/AsignarHorario">HORARIO</Nav.Link>
                                                        <Nav.Link href="#pricing">VALIDAR</Nav.Link>
                                                        <Nav.Link href="#features">ENCUESTA</Nav.Link>
                                                        <Nav.Link href="/Materias">MATERIAS</Nav.Link>
                                                        <Nav.Link href="/RolesEstudiantes">ROLES</Nav.Link>
                                                        <Nav.Link href="#features">BOT</Nav.Link>
                                                        <Nav.Link href="/Peticiones">PETICIONES</Nav.Link>
                                                        <Nav.Link href="/CorreoUpdate">CORREO</Nav.Link>
                                                        <Nav.Link href="/AgendaConcejero">AGENDA</Nav.Link>
                                                    </Nav>
                                                )
                                            } else if (elem.userType === "docente" && "docente concejero") {
                                                return (
                                                    <Nav>
                                                        <Nav.Link href="/Formulario">NOTAS</Nav.Link>
                                                        <Nav.Link href="/Citas">CITAS</Nav.Link>
                                                        <Nav.Link href="/AgendaConcejero">AGENDA</Nav.Link>
                                                    </Nav>
                                                )
                                            } else if (elem.userType === "docente") {
                                                return (
                                                    <Nav>
                                                        <Nav >
                                                            <Nav.Link href="/Notas">NOTAS</Nav.Link>
                                                        </Nav>
                                                    </Nav>
    
                                                )
                                            } else if (elem.userType === "user_master") {
                                                // console.log(elem.userType);
                                                return (
                                                    <Nav >
                                                        <Nav >
                                                            <Nav.Link href="/PeticionesAdmin">PETICIONES</Nav.Link>
                                                            <Nav.Link href="/Roles">ROLES</Nav.Link>
                                                            <Nav.Link href="/Credenciales">CREDENCIALES</Nav.Link>
                                                            <Nav.Link href="/Media">MEDIA</Nav.Link>
                                                        </Nav>
                                                    </Nav>
                                                )
                                            } else if (elem.userType === "estudiante") {
                                                // console.log(elem.userType);
                                                return (
                                                    <Nav className="mx-auto">
                                                        <Nav>
                                                            <Nav.Link href="/Notastable">NOTAS</Nav.Link>
                                                            <Nav.Link href="/AgendaEstudiante">AGENDA</Nav.Link>
                                                            <Nav.Link href="/Tutorias">TUTORIAS</Nav.Link>
                                                            <Nav.Link href="/AteneoTutorias">TUTORIAS ATENEO</Nav.Link>
                                                        </Nav>
                                                    </Nav>
                                                )
                                            }                                      
                                    })
                                }
                            </Nav>

                            <Nav className="ms-auto">
                                {this.state.userType.map(elem => {
                                    // console.log(this.state.userType)
                                    if (elem.userType === "administrador" && "docente" && "docente concejero") {
                                        // console.log(elem.userType);
                                        return (
                                            <NavDropdown title={titulos} >
                                                <NavDropdown.Item href="/Perfil">Perfil</NavDropdown.Item>
                                                <NavDropdown.Item href="/Pqr">PQRS</NavDropdown.Item>
                                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                                <NavDropdown.Divider />
                                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                                            </NavDropdown>
                                        )
                                    } else if (elem.userType === "administrador" && "docente") {
                                        // console.log(elem.userType);
                                        return (
                                            <NavDropdown title={titulos} >
                                                <NavDropdown.Item href="/Perfil">Perfil</NavDropdown.Item>
                                                <NavDropdown.Item href="/Pqr">PQRS</NavDropdown.Item>
                                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                                <NavDropdown.Divider />
                                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                                            </NavDropdown>
                                        )
                                    } else if (elem.userType === "docente" && "docente concejero") {
                                        // console.log(elem.userType);
                                        return (
                                            <NavDropdown title={titulos} >
                                                <NavDropdown.Item href="/Perfil">Perfil</NavDropdown.Item>
                                                <NavDropdown.Item href="/Pqr">PQRS</NavDropdown.Item>
                                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                                <NavDropdown.Divider />
                                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                                            </NavDropdown>
                                        )
                                    } else if (elem.userType === "user_master") {
                                        // console.log(elem.userType);
                                        return (
                                            <NavDropdown title={titulos} >
                                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                                <NavDropdown.Divider />
                                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                                            </NavDropdown>
                                        )

                                    } else if (elem.userType === "estudiante") {
                                        // console.log(elem.userType);
                                        return (
                                            <NavDropdown title={titulos} >
                                                <NavDropdown.Item href="/Perfil">Perfil</NavDropdown.Item>
                                                <NavDropdown.Item href="/Pqr">PQRS</NavDropdown.Item>
                                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                                <NavDropdown.Divider />
                                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                                            </NavDropdown>
                                        )
                                    } else if (elem.userType === "docente") {
                                        // console.log(elem.userType);
                                        return (
                                            <NavDropdown title={titulos} >
                                                <NavDropdown.Item href="/Perfil">Perfil</NavDropdown.Item>
                                                <NavDropdown.Item href="/Pqr">PQRS</NavDropdown.Item>
                                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                                <NavDropdown.Divider />
                                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                                            </NavDropdown>
                                        )
                                    }
                                }

                                )

                                }
                                {/* <NavDropdown title={titulos} >
                                <NavDropdown.Item href="/Perfil">Perfil</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">PQRS</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">MUE</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item onClick={this.cerrarsesion}>SALIR</NavDropdown.Item>
                            </NavDropdown> */}
                            </Nav>
                        </Navbar.Collapse>

                    </Container>

                </Navbar >

                <div className='py-5 h-100'>
                    <div className='d-flex justify-content-center align-items-center h-100'>
                        <div className=''>
                            <div className=''>
                                <div className='align-items-center'>
                                    <div className=' p-4 p-lg-5 text-black'>
                                        <h1>BIENVENIDO A ATENEO</h1>
                                    </div>
                                    <div className='form'>
                                        <div className="fb-page" data-href="https://www.facebook.com/UPBBGA" data-tabs="timeline" data-width="" data-height="" data-small-header="false" data-adapt-container-width="true" data-hide-cover="false" data-show-facepile="true"><blockquote cite="https://www.facebook.com/UPBBGA" className="fb-xfbml-parse-ignore"><a href="https://www.facebook.com/UPBBGA">UPB Seccional Bucaramanga OFICIAL</a></blockquote></div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>

                </div>
            </div>

        );
    }
}

export default Principal;
